gNW(){return"The text is written in a compact Greek uncial script using black ink, arranged in a single column per page with approximately 25-30 lines per folio. It employs scriptio continua (continuous writing without word separation)."},
gNU(){return"The manuscript was acquired in the 1930s by Alfred Chester Beatty from an antiquities dealer in Egypt, with the most likely place of discovery being the Faiyum region in Egypt."},
