gPW(){return"From a textological perspective, the codex is a mixed manuscript; its text of the Pauline and General Epistles exhibits the characteristics of the Alexandrian text-type and is classified as Category III, while the text of Acts and Revelation follows the Byzantine tradition, placing it in Category V."},
