gQ2(){return"\u041f\u043e\u0440\u0444\u0438\u0440\u0456\u0430\u043d\u0441\u044c\u043a\u0438\u0439 \u043a\u043e\u0434\u0435\u043a\u0441 (P<sup>apr</sup> 025)"},
gPZ(){return"IX \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u044f \u043d.\u0435."},
gPX(){return"\u0412\u0441\u044f \u043a\u043d\u0438\u0433\u0430 \u041e\u0431'\u044f\u0432\u043b\u0435\u043d\u043d\u044f \u043e\u043a\u0440\u0456\u043c \u0444\u0440\u0430\u0433\u043c\u0435\u043d\u0442\u0456\u0432 (16:13-21); (20:1-8); (22:7-21)."},
gQ0(){return"\u041f\u043e\u0440\u0444\u0456\u0440\u0456\u0430\u043d\u0441\u044c\u043a\u0438\u0439 \u043a\u043e\u0434\u0435\u043a\u0441 \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u0438\u0439 \u043d\u0430 \u043f\u0435\u0440\u0433\u0430\u043c\u0435\u043d\u0442\u0456 \u0442\u0430 \u0441\u043a\u043b\u0430\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u0437 327 \u0430\u0440\u043a\u0443\u0448\u0456\u0432 \u0440\u043e\u0437\u043c\u0456\u0440\u043e\u043c \u043f\u0440\u0438\u0431\u043b\u0438\u0437\u043d\u043e 16 \xd7 13 \u0441\u043c. \u0426\u0435 \u043f\u0430\u043b\u0456\u043c\u043f\u0441\u0435\u0441\u0442, \u0449\u043e \u043c\u0456\u0441\u0442\u0438\u0442\u044c \u043a\u043e\u043c\u0435\u043d\u0442\u0430\u0440 \u0404\u0432\u0444\u0430\u043b\u0456\u044f \u0434\u043e \u0414\u0456\u044f\u043d\u044c \u0442\u0430 \u043f\u043e\u0441\u043b\u0430\u043d\u044c \u041f\u0430\u0432\u043b\u0430 \u043f\u043e\u0440\u044f\u0434 \u0456\u0437 \u0431\u0456\u0431\u043b\u0456\u0439\u043d\u0438\u043c \u0442\u0435\u043a\u0441\u0442\u043e\u043c."},
gQ1(){return"\u0422\u0435\u043a\u0441\u0442 \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u0438\u0439 \u0433\u0440\u0435\u0446\u044c\u043a\u0438\u043c \u0443\u043d\u0446\u0456\u0430\u043b\u044c\u043d\u0438\u043c \u043f\u043e\u0447\u0435\u0440\u043a\u043e\u043c, \u0440\u043e\u0437\u043c\u0456\u0449\u0435\u043d\u0438\u043c \u0432 \u043e\u0434\u043d\u0443 \u043a\u043e\u043b\u043e\u043d\u043a\u0443 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 \u0437 24 \u0440\u044f\u0434\u043a\u0430\u043c\u0438, \u0456\u0437 \u0437\u0430\u0441\u0442\u043e\u0441\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0434\u0438\u0445\u0430\u043b\u044c\u043d\u0438\u0445 \u0437\u043d\u0430\u043a\u0456\u0432, \u0430\u043a\u0446\u0435\u043d\u0442\u0456\u0432 \u0442\u0430 \u0430\u043f\u043e\u0441\u0442\u0440\u043e\u0444\u0456\u0432."},
gQ_(){return"\u0420\u0443\u043a\u043e\u043f\u0438\u0441 \u0431\u0443\u0432 \u0432\u0438\u044f\u0432\u043b\u0435\u043d\u0438\u0439 \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043c \u0444\u043e\u043d \u0422\u0456\u0448\u0435\u043d\u0434\u043e\u0440\u0444\u043e\u043c \u0443 1862 \u0440\u043e\u0446\u0456 \u0432 \u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0437\u0456, \u0420\u043e\u0441\u0456\u044f, \u0443 \u0432\u043e\u043b\u043e\u0434\u0456\u043d\u043d\u0456 \u0430\u0440\u0445\u0456\u043c\u0430\u043d\u0434\u0440\u0438\u0442\u0430 \u041f\u043e\u0440\u0444\u0438\u0440\u0456\u044f \u0423\u0441\u043f\u0435\u043d\u0441\u044c\u043a\u043e\u0433\u043e. \u0422\u0456\u0448\u0435\u043d\u0434\u043e\u0440\u0444\u0443 \u0431\u0443\u043b\u043e \u0434\u043e\u0437\u0432\u043e\u043b\u0435\u043d\u043e \u0432\u0437\u044f\u0442\u0438 \u0440\u0443\u043a\u043e\u043f\u0438\u0441 \u0434\u043e \u041b\u0435\u0439\u043f\u0446\u0438\u0433\u0430 \u0434\u043b\u044f \u0440\u043e\u0437\u0448\u0438\u0444\u0440\u0443\u0432\u0430\u043d\u043d\u044f \u043d\u0438\u0436\u043d\u044c\u043e\u0433\u043e \u0442\u0435\u043a\u0441\u0442\u0443."},
gPW(){return"\u0417 \u0442\u0435\u043a\u0441\u0442\u043e\u043b\u043e\u0433\u0456\u0447\u043d\u043e\u0457 \u0442\u043e\u0447\u043a\u0438 \u0437\u043e\u0440\u0443, \u043a\u043e\u0434\u0435\u043a\u0441 \u0454 \u0437\u043c\u0456\u0448\u0430\u043d\u0438\u043c \u043c\u0430\u043d\u0443\u0441\u043a\u0440\u0438\u043f\u0442\u043e\u043c: \u0442\u0435\u043a\u0441\u0442 \u043f\u043e\u0441\u043b\u0430\u043d\u044c \u0430\u043f\u043e\u0441\u0442\u043e\u043b\u0430 \u041f\u0430\u0432\u043b\u0430 \u0442\u0430 \u0437\u0430\u0433\u0430\u043b\u044c\u043d\u0438\u0445 \u043f\u043e\u0441\u043b\u0430\u043d\u044c \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0430\u0454 \u0440\u0438\u0441\u0438 \u0430\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u0442\u0438\u043f\u0443 \u0442\u0430 \u0432\u0456\u0434\u043d\u043e\u0441\u0438\u0442\u044c\u0441\u044f \u0434\u043e \u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0456\u0457 III, \u0442\u043e\u0434\u0456 \u044f\u043a \u0442\u0435\u043a\u0441\u0442 \u0414\u0456\u044f\u043d\u044c \u0442\u0430 \u041e\u0431'\u044f\u0432\u043b\u0435\u043d\u043d\u044f \u043d\u0430\u043b\u0435\u0436\u0438\u0442\u044c \u0434\u043e \u0432\u0456\u0437\u0430\u043d\u0442\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u0442\u0438\u043f\u0443 \u0456 \u043a\u043b\u0430\u0441\u0438\u0444\u0456\u043a\u0443\u0454\u0442\u044c\u0441\u044f \u044f\u043a \u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0456\u044f V."},
gPY(){return"\u041d\u0430\u0440\u0430\u0437\u0456 \u041f\u043e\u0440\u0444\u0456\u0440\u0456\u0430\u043d\u0441\u044c\u043a\u0438\u0439 \u043a\u043e\u0434\u0435\u043a\u0441 \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u0454\u0442\u044c\u0441\u044f \u0432 \u0420\u043e\u0441\u0456\u0439\u0441\u044c\u043a\u0456\u0439 \u043d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0456\u0439 \u0431\u0456\u0431\u043b\u0456\u043e\u0442\u0435\u0446\u0456 \u0443 \u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0437\u0456."},
